import React from 'react';
import './BestLayers.scss';

const BestLayers = () => (
  <div className="BestLayers">
    <h2>Most downloaded layers</h2>
    <div className="layers">
      <div className="layer" />
      <div className="layer" />
      <div className="layer" />
    </div>
    <h2>Latest OS</h2>
    <div className="layers">
      <div className="layer" />
      <div className="layer" />
      <div className="layer" />
    </div>
  </div>
);

export default BestLayers;
